"""
A split of an integer array is good if:
The array is split into three non-empty contiguous subarrays - named left, mid, right respectively from left to right.
The sum of the elements in left is less than or equal to the sum of the elements in mid, and the sum of the elements in mid is less than or equal to the sum of the elements in right.
Given nums, an array of non-negative integers, return the number of good ways to split nums. As the number may be too large, return it modulo 109 + 7.

Example 1:

Input: nums = [1,1,1]
Output: 1
Explanation: The only good way to split nums is [1] [1] [1].
Example 2:

Input: nums = [1,2,2,2,5,0]
Output: 3
Explanation: There are three good ways of splitting nums:
[1] [2] [2,2,5,0]
[1] [2,2] [2,5,0]
[1,2] [2,2] [5,0]
Example 3:

Input: nums = [3,2,1]
Output: 0
Explanation: There is no good way to split nums.
 
Constraints:
3 <= nums.length <= 105
0 <= nums[i] <= 104
"""
import time

class Solution:
    def waysToSplit(self, nums: list[int]) -> int:
        numberOfElements: int = len(nums)
        print(f"numberOfElements: {numberOfElements}")
        sumOfNums: list[int] = [nums[0]]
        for index in range(1, numberOfElements):
            sumOfNums.append(sumOfNums[index - 1] + nums[index])

        indicesList: list[list] = []
        leftWall: int = 1
        rightWall: int = numberOfElements - 1
        loopCount: int = 0
        while (leftWall < rightWall):
            loopCount = loopCount + 1
            sumOfLeft: int = sumOfNums[leftWall - 1]
            sumOfMiddle: int = sumOfNums[rightWall - 1] - sumOfLeft
            sumOfRight: int = sumOfNums[numberOfElements - 1] - sumOfNums[rightWall - 1]
            if sumOfRight < sumOfLeft:
                leftWall = 1
                rightWall -= 1
                continue
            if sumOfRight < sumOfMiddle:
                leftWall += 1
                continue
            if sumOfLeft <= sumOfMiddle <= sumOfRight:
                indicesList.append([leftWall, rightWall])
            if sumOfLeft > sumOfMiddle or (leftWall + 1) >= rightWall:
                leftWall = 1
                rightWall -= 1
            else:    
                leftWall += 1
        
        if len(indicesList) < 20:
            [self.printWays(nums, way) for way in indicesList]
        print(f"loopCount: {loopCount}")
        return len(indicesList)

    def printWays(self, nums: list[int], indices: list[int]):
        print(f"{str(nums[:indices[0]])} {str(nums[indices[0]:indices[1]])} {str(nums[indices[1]:])}")

